  { page_num = 4, line = 4, pos0 = { x = 74, y = 242 }, pos1 = { x = 1122, y = 242 }, text = "Where civil blood makes civil hands unclean.", p0 = "/body/DocFragment[4]/body/div/div/div/div/blockquote/p/text()[4].1", p1 = "/body/DocFragment[4]/body/div/div/div/div/blockquote/p/text()[4].45" },
  { page_num = 4, line = 5, pos0 = { x = 74, y = 302 }, pos1 = { x = 1122, y = 302 }, text = "A pair of star-cross'd lovers take their life;", p0 = "/body/DocFragment[4]/body/div/div/div/div/blockquote/p/text()[6].1", p1 = "/body/DocFragment[4]/body/div/div/div/div/blockquote/p/text()[6].47" },
  { page_num = 4, line = 6, pos0 = { x = 74, y = 362 }, pos1 = { x = 1122, y = 362 }, text = "Do with their death bury their parents' strife.", p0 = "/body/DocFragment[4]/body/div/div/div/div/blockquote/p/text()[8].1", p1 = "/body/DocFragment[4]/body/div/div/div/div/blockquote/p/text()[8].48" },
  { page_num = 4, line = 7, pos0 = { x = 74, y = 422 }, pos1 = { x = 1122, y = 422 }, text = "And the continuance of their parents' rage,", p0 = "/body/DocFragment[4]/body/div/div/div/div/blockquote/p/text()[10].1", p1 = "/body/DocFragment[4]/body/div/div/div/div/blockquote/p/text()[10].44" },
  { page_num = 4, line = 8, pos0 = { x = 74, y = 482 }, pos1 = { x = 1122, y = 482 }, text = "Is now the two hours' traffic of our stage;", p0 = "/body/DocFragment[4]/body/div/div/div/div/blockquote/p/text()[12].1", p1 = "/body/DocFragment[4]/body/div/div/div/div/blockquote/p/text()[12].44" },
  { page_num = 4, line = 9, pos0 = { x = 74, y = 542 }, pos1 = { x = 1122, y = 542 }, text = "What here shall miss, our toil shall strive to mend.", p0 = "/body/DocFragment[4]/body/div/div/div/div/blockquote/p/text()[14].1", p1 = "/body/DocFragment[4]/body/div/div/div/div/blockquote/p/text()[14].53" },
  { page_num = 4, line = 10, pos0 = { x = 74, y = 602 }, pos1 = { x = 1122, y = 602 }, text = "Act I\nPrologue\nTwo households, both alike in dignity, In fair Verona, where we lay our scene, From ancient grudge break to new mutiny, Where civil blood makes civil hands unclean. From forth the fatal loins of these two foes A pair of star-cross'd lovers take their life; Whole misadventured piteous overthrows Do with their death bury their parents' strife. The fearful passage of their death-mark'd love, And the continuance of their parents' rage, Which, but their children's end, nought could remove, Is now the two hours' traffic of our stage; The which if you with patient ears attend, What here shall miss, our toil shall strive to mend.", p0 = "/body/DocFragment[4].1", p1 = "/body/DocFragment[4]/body/div/div/div/div/blockquote/p/text()[14].53" },
